import React from 'react';
import './KilterBoard.css'; // Import the CSS file for styling

function KilterBoard() {
  return (
    <div className="kilter-board-container">
      <h1>The Kilter Board</h1>
      <p>The Kilter Board offers a dynamic and interactive climbing experience. It is designed to cater to climbers of all skill levels, allowing users to choose routes, track progress, and challenge themselves in a fun and engaging way.</p>
      <p>Our app enhances this experience by bringing AI-generated beta based on routes that adapt to your skill level, ensuring that there's always a new challenge waiting for you. Share your routes, compete with friends, and be a part of a growing community of climbing enthusiasts.</p>
      <p>For more information about Kilter Board, please visit their website: https://settercloset.com/pages/the-kilter-board</p>
    </div>
  );
}

export default KilterBoard;
